declare module "\*.jpg" {
  const content: string;
  export default content;
}

declare module "\*.png" {
  const content: string;
  export default content;
}

declare module "\*.json" {
  const content: string;
  export default content;
}

declare module "\*.less" {
  const content: any;
  export default content;
}

declare module "\*.svg" {
  const content: any;
  export default content;
}
